import React from 'react';
import {View, Text, StyleSheet} from 'react-native';

export default class Finish extends React.Component{
    render(){
        return(
            <View>
                <Text>Confirmation</Text>
                <Text>Your order is on its way!</Text>
            </View>
        )
    }
}
